--
-- Disparadores `cuentacorriente`
--
DELIMITER $$
CREATE TRIGGER `ctasaldo_trigger` BEFORE INSERT ON `cuentacorriente` FOR EACH ROW BEGIN
        DECLARE old_saldo DOUBLE;
        IF NEW.ctacliente IS NOT NULL AND NEW.ctaproveedor IS NULL THEN
            SELECT saldo INTO old_saldo FROM clientes WHERE id = NEW.ctacliente LIMIT 1;
        ELSEIF NEW.ctaproveedor IS NOT NULL AND NEW.ctacliente IS NULL THEN
            SELECT saldo INTO old_saldo FROM proveedores WHERE id = NEW.ctaproveedor LIMIT 1;
        END IF;

        IF NEW.ctatipo = 'CR' THEN
            SET NEW.ctasaldo = IFNULL(old_saldo,0) + NEW.ctaimporte;
        END IF;

        IF NEW.ctatipo = 'DB' THEN
            SET NEW.ctasaldo = IFNULL(old_saldo,0) - NEW.ctaimporte;
        END IF;

        IF NEW.ctacliente IS NOT NULL AND NEW.ctaproveedor IS NULL THEN
            UPDATE clientes SET saldo = NEW.ctasaldo WHERE id = NEW.ctacliente;
        ELSEIF NEW.ctaproveedor IS NOT NULL AND NEW.ctacliente IS NULL THEN
            UPDATE proveedores SET saldo = NEW.ctasaldo WHERE id = NEW.ctaproveedor;
        END IF;
        
    END
$$
DELIMITER ;

