DELIMITER $$
CREATE TRIGGER `saldo_trigger` BEFORE INSERT ON `cuentacorriente_vendedores` FOR EACH ROW BEGIN
    	DECLARE old_saldo DOUBLE;
        SELECT saldo INTO old_saldo FROM cuentacorriente_vendedores WHERE idvendedor = NEW.idvendedor ORDER BY id DESC LIMIT 1;
    	IF NEW.comision IS NOT NULL THEN
        	SET NEW.saldo = old_saldo + NEW.comision;
        END IF;
        
        IF NEW.pago IS NOT NULL THEN
        	SET NEW.saldo = old_saldo - NEW.pago;
        END IF;
        
        IF NEW.saldo IS NOT NULL THEN
            UPDATE vendedores SET saldo = NEW.saldo WHERE id = NEW.idvendedor;
        END IF;
    END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `saldo_update_trigger` BEFORE UPDATE ON `cuentacorriente_vendedores` FOR EACH ROW BEGIN
		DECLARE old_saldo DOUBLE;
		IF NEW.idfactura IS NOT NULL AND OLD.idpresupuesto IS NOT NULL THEN            
            SELECT saldo INTO old_saldo 
            FROM cuentacorriente_vendedores 
            WHERE idvendedor = OLD.idvendedor AND idfactura IS NOT NULL
            ORDER BY fecha DESC LIMIT 1;
            IF NEW.comision IS NOT NULL THEN
                SET NEW.saldo = old_saldo + NEW.comision;
            ELSEIF OLD.comision IS NOT NULL THEN
            	SET NEW.saldo = old_saldo + OLD.comision;
            END IF;

            IF NEW.pago IS NOT NULL THEN
                SET NEW.saldo = old_saldo - NEW.pago;
            ELSEIF OLD.pago IS NOT NULL THEN
            	SET NEW.saldo = old_saldo - OLD.pago;
            END IF;
            
            IF NEW.saldo IS NOT NULL THEN
				UPDATE vendedores SET saldo = NEW.saldo WHERE id = OLD.idvendedor;
			END IF;
		END IF;
    END
$$
DELIMITER ;

